import React from "react";
import "../src/css/home.css";
import { useNavigate } from "react-router-dom";
function Home() {
  const navigate=useNavigate();
  const bp=()=>{
    navigate("/bgmi");
  }
  const fp=()=>{
    navigate("/ff");
  }
  return (
    <div className="hmain">
        <h3 id="hh">MOBILE GAMES</h3>
        <button id="hb" onClick={bp}></button>
        <button id="hf" onClick={fp}></button>
    </div>
  );
}
export default Home;
